import React from "react";
import "./InitialForm.css";

var today = new Date();
// function isValidUSZip(sZip) {
//     return /^\d{5}(-\d{4})?$/.test(sZip);
//  }

export default function InitialForm() {
    return(
        <div className="initialForm">
            <h1> Tell us about you.</h1>
            <form>
                <div className="gender-div">
                    <label>Gender:</label>
                    <input id="male-button"
                        type="button"
                        required
                    />
                    <input id="female-button"
                        type="button"
                        required
                    />
                </div>

                <div className="dob-div">
                    <label>Date of birth:</label>
                    <input id="month-input"
                        type="number"
                        required
                        min={1}
                        max={12}
                    />
                    <input id="day-input"
                        type="number"
                        required
                        min={1}
                        max={31}
                    />
                    <input id="year-input"
                        type="number"
                        required
                        min={1900}
                        max={today.getFullYear() - 17}
                    />
                </div>

                <div className="zip-code-div">
                    <label>ZIP code:</label>
                    <input
                        type="number"
                        required
                    />
                </div>

            </form>
        </div>
    );
}
